import React from "react";
import "./Footer.css"
import github from "./imgs/github.svg"
import linkedin from "./imgs/linkedin.svg"
import medium from "./imgs/medium.svg"

export default function Footer() {
    return (
        <div id="footer" class="footer text-center mt-5">
            <div class="container">
                <a target="_blank" rel="noopener noreferrer" href="https://www.linkedin.com/in/colbe-roberson-a01734221/"><img class="footer-img" id="linkedin" height="50" width="50" src={linkedin} /></a>
                <a target="_blank" rel="noopener noreferrer" href="https://medium.com/@roberson.colbe_91639" class="mx-2"><img class="footer-img" id="medium" height="50" width="50" src={medium} /></a>
                <a target="_blank" rel="noopener noreferrer" href="https://github.com/cgr28"><img class="footer-img" id="github" height="50" width="50" src={github} /></a>
            </div>
        </div>
    )
}
